/**
  * @brief 绘图函数
  * @note 无
  * @param Delay：延时时间
  * @retval 无
  */
static void _Draw(int Delay)
{
  GUI_SetPenSize(5);
  GUI_SetColor(GUI_RED);
  GUI_DrawLine(Rect.x0 + 3, Rect.y0 + 3, Rect.x1 - 3, Rect.y1 - 3);
  GUI_Delay(Delay);
  GUI_SetColor(GUI_GREEN);
  GUI_DrawLine(Rect.x0 + 3, Rect.y1 - 3, Rect.x1 - 3, Rect.y0 + 3);
  GUI_Delay(Delay);
  GUI_SetColor(GUI_WHITE);
  GUI_SetFont(&GUI_FontComic24B_ASCII);
  GUI_SetTextMode(GUI_TM_TRANS);
  GUI_DispStringInRect("Closed", &Rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
  GUI_Delay(Delay);
}

/**
  * @brief 内存设备演示函数
  * @note 无
  * @param 无
  * @retval 无
  */
static void _DemoMemDev(void)
{
  GUI_MEMDEV_Handle hMem = 0;
  int i, j;
	int UseBytes = 0;
	char buf[30] = {0};
	
	/* 设置背景色 */
  GUI_SetBkColor(GUI_BLACK);
  GUI_Clear();
	
	/* 显示提示文字 */
  GUI_SetColor(GUI_WHITE);
  GUI_SetFont(GUI_FONT_32_ASCII);
  GUI_DispStringHCenterAt("MEMDEV_MemDev - Sample", 400, 5);
  GUI_SetFont(GUI_FONT_24_ASCII);
  GUI_DispStringHCenterAt("Shows the advantage of using a\nmemorydevice", 400, 45);
  GUI_SetFont(GUI_FONT_16_ASCII);
  GUI_DispStringHCenterAt("Draws the picture\nwithout a\nmemory device", 100, 90);
  GUI_DispStringHCenterAt("Draws the picture\nusing a\nmemory device", 700, 90);
	
	/* 创建内存设备 */
	hMem = GUI_MEMDEV_Create(Rect.x0, Rect.y0, Rect.x1 - Rect.x0, Rect.y1 - Rect.y0);
	/* 选择需要使用的内存设备 */
	GUI_MEMDEV_Select(hMem);
	/* 绘图到内存设备 */
	_Draw(0);

	/* 选择内存设备，0表示选中LCD */
	GUI_MEMDEV_Select(0);
	for(j = 0; j < 4; j++)
	{
		for (i = 0; i < 3; i++)
		{
			GUI_Delay(250);
			/* 清除指定区域的内容 */
			GUI_ClearRect(Rect.x0 + 600, Rect.y0, Rect.x1 + 600, Rect.y1);
			GUI_Delay(250);
			/* 将内存设备中的数据写入LCD */
			GUI_MEMDEV_CopyToLCDAt(hMem, Rect.x0 + 600, Rect.y0);
		}
		GUI_Delay(500);
		
		/* 没有使用内存设备的绘图 */
		_Draw(400);
		GUI_Delay(400);
		GUI_ClearRect(0, 140, 319, 229);
	}
	GUI_MEMDEV_Delete(hMem);

	GUI_Delay(1000);
	GUI_ClearRect(0, 45, 799, 479);
	GUI_SetFont(GUI_FONT_16B_1);
	
	/* 使用兼容LCD颜色格式的内存设备显示位图 */
	hMem = GUI_MEMDEV_Create(0, 0, 324, 87);
	GUI_MEMDEV_Select(hMem);
	GUI_DrawBitmap(&bmwildfire, 0, 0);
	GUI_MEMDEV_Select(0);
	GUI_MEMDEV_CopyToLCDAt(hMem, 20, 62);
	GUI_DispStringAt("GUI_MEMDEV_Create()", 20, 40);
	UseBytes = GUI_ALLOC_GetNumUsedBytes();
	sprintf(buf, "UsedMemBytes: %d", UseBytes);
	GUI_DispStringAt(buf, 20, 152);
	GUI_MEMDEV_Delete(hMem);
	
	/* 使用固定颜色格式的内存设备显示位图 */
	hMem = GUI_MEMDEV_CreateFixed(0, 0, 324, 87,
	                              GUI_MEMDEV_NOTRANS,/* */
	                              GUI_MEMDEV_APILIST_16,
	                              GUICC_565);
	GUI_MEMDEV_Select(hMem);
	GUI_DrawBitmap(&bmwildfire, 0, 0);
	GUI_MEMDEV_Select(0);
	GUI_MEMDEV_CopyToLCDAt(hMem, 456, 62);
	GUI_DispStringAt("GUI_MEMDEV_CreateFixed()", 456, 40);
	UseBytes = GUI_ALLOC_GetNumUsedBytes();
	sprintf(buf, "UsedMemBytes: %d", UseBytes);
	GUI_DispStringAt(buf, 456, 152);
	GUI_MEMDEV_Delete(hMem);
}

