/**
  * @brief GUI主任务
  * @note 无
  * @param 无
  * @retval 无
  */
void MainTask(void)
{
	/* 运行内存设备演示DEMO */
  _DemoMemDev();

	while(1)
	{
		GUI_Delay(100);
	}
	
	
}

